(70, 45, 3, 'Cleaning your kitchen is now a fun process with Prestige clean home dish brush. The dish brush effectively cleans gas stoves, sinks, kitchen slabs and kitchen tiles etc. The soft bristles offer scratch-free cleaning. The dish brush also protects your hands from chemicals.\nThe self dispensing cleaning brush with soap reservoir is very easy to use. Just open the top and add the soap or detergent. Its hidden plunger action releases soap into bristles when pressed and you can clean without using extra detergent or soap. It scrubs pots, greasy dishes, pans, tiles with ease.', '2021-10-09 00:00:00', '2021-10-09 00:00:00', 'NOT_DELETED'),
(71, 46, 3, 'Best foam scrubber pad for utensils washing ,Kitchen, Wash Basin ,Bathroom, Bathtub, Tiles, Car Wash , . Make your home a Bright Home !!! High Quality Scrub Pads essential for your home pantry . Value pack is best buy for savings .Double Sided 2in1 Sponge has One Non Scratch Soft Spongy Side and One Rough Scouring Scrubber Pad for tough stains .Surface Cleaning Sponge with Anti Odour Bacteria Resistant Material. Soft for hands, Hard for Stains ! Scrub pads attached with sponge pad. These Long lasting nylon scrubbers are highly durable, Guarantee for best results .It will take seconds for you to clean the dirty utensils with these Scrub sponge Pads .', '2021-10-09 00:00:00', '2021-10-09 00:00:00', 'NOT_DELETED'),
(72, 47, 3, 'In life, windows will inevitably be wet or dirty, which will also affect our appreciation of the scenery. At this time, we need a window squeegee to clean up. The window squeegee not only easy clean up but also light. Make you can clean for a long time and won\'t feel tied.', '2021-10-09 00:00:00', '2021-10-09 00:00:00', 'NOT_DELETED'),
(73, 48, 3, 'Keep everyday spaces looking clean and presentable with help from this dustpan and brush set. The set includes an ergonomic handheld brush and a sturdy dustpan that work together for quick, easy clean-ups.?The brushs soft bristles effectively sweep up dust, dirt, crumbs, and other dry messes, while the wide-mouth dustpans soft moulded lip directs dust and debris into the pan (not under it).', '2021-10-09 00:00:00', '2021-10-09 00:00:00', 'NOT_DELETED'),
